function initModule(element) {
    $(element).tooltip()
}

function createDonutGraph(selector, labels, datas, colors) {
    var data = [{
        label: labels[0],
        data: datas[0]
    },
    {
        label: labels[1],
        data: datas[1]
    },
    {
        label: labels[2],
        data: datas[2]
    }];
    var options = {
        series: {
            pie: {
                show: true,
                innerRadius: 0.7
            }
        },
        legend: {
            position: "sw",
            margin: [0, 0],
            noColumns: 2,
            show: false,
            labelFormatter: function (label, series) {
                return '<div style="font-size:16px;">&nbsp;' + label + '</div>'
            },
            labelBoxBorderColor: null,
            width: 20
        },
        grid: {
            hoverable: true,
            clickable: true
        },
        colors: colors,
        tooltip: true,
        tooltipOpts: {
            content: "%s, %p.0VN"
        }
    };

    $.plot($(selector), data, options);
}

function loadUserSalaryPopover() {
    $('#salaryView').popover({
        trigger: 'focus',
        html: true,
        animation: true,
        placement: 'right',
        template: '<div class="popover" role="tooltip"><div class="arrow"></div><h3 class="popover-header"></h3><div class="popover-body"></div></div>'
    })
}

function initSelect2() {
    $(".select2").select2();

    $(".select2-limiting").select2({
        maximumSelectionLength: 2
    });

}

function togglePopover(id) {
    $(id).popover('toggle');
}

function saveFormInputValue() {
    var markup = $('#summernote').summernote('code');
    return markup;
};

function formInputDialogInit(content, hint) {

    $.ajax({
        url: 'https://api.github.com/emojis',
        async: false
    }).then(function (data) {
        window.emojis = Object.keys(data);
        window.emojiUrls = data;
    });;

    $('#summernote').summernote({
        placeholder: hint,
        tabsize: 2,
        height: 400,
        hint: [{
            match: /:([\-+\w]+)$/,
            search: function (keyword, callback) {
                callback($.grep(emojis, function (item) {
                    return item.indexOf(keyword) === 0;
                }));
            },
            template: function (item) {
                var content = emojiUrls[item];
                return '<img src="' + content + '" width="20" /> :' + item + ':';
            },
            content: function (item) {
                var url = emojiUrls[item];
                if (url) {
                    return $('<img />').attr('src', url).css('width', 20)[0];
                }
                return '';
            }
        }]
    });

    $('#summernote').summernote('code', content);
}

function getContentFromSummerNote(id) {
    var markup = $(id).summernote('code');
    return markup;
};

function initSummerNoteTemplate(id, content) {

    $.ajax({
        url: 'https://api.github.com/emojis',
        async: true
    }).then(function (data) {
        window.emojis = Object.keys(data);
        window.emojiUrls = data;
    });;

    $(id).summernote({
        placeholder: 'Son mu email...',
        tabsize: 2,
        height: 300,
        hint: [{
            match: /:([\-+\w]+)$/,
            search: function (keyword, callback) {
                callback($.grep(emojis, function (item) {
                    return item.indexOf(keyword) === 0;
                }));
            },
            template: function (item) {
                var content = emojiUrls[item];
                return '<img src="' + content + '" width="20" /> :' + item + ':';
            },
            content: function (item) {
                var url = emojiUrls[item];
                if (url) {
                    return $('<img />').attr('src', url).css('width', 20)[0];
                }
                return '';
            }
        }, {
            mentions: ['sender : Tn ngi gi', 'receiver : Tn ngi nhn'],
            match: /\B@(\w*)$/,
            search: function (keyword, callback) {
                callback($.grep(this.mentions, function (item) {
                    return item.indexOf(keyword) == 0;
                }));
            },
            template: function (item) {
                return '<span>' + item + '</span>';
            },
            content: function (item) {
                return '{{' + item.toString().charAt(0) + '}}';
            }
        }]
    });

    $(id).summernote('code', content);
}

function initSummerNoteTemplateWithHeight(id, content, height) {

    $.ajax({
        url: 'https://api.github.com/emojis',
        async: true
    }).then(function (data) {
        window.emojis = Object.keys(data);
        window.emojiUrls = data;
    });;

    $(id).summernote({
        placeholder: 'Son mu email...',
        tabsize: 2,
        height: height,
        hint: [{
            match: /:([\-+\w]+)$/,
            search: function (keyword, callback) {
                callback($.grep(emojis, function (item) {
                    return item.indexOf(keyword) === 0;
                }));
            },
            template: function (item) {
                var content = emojiUrls[item];
                return '<img src="' + content + '" width="20" /> :' + item + ':';
            },
            content: function (item) {
                var url = emojiUrls[item];
                if (url) {
                    return $('<img />').attr('src', url).css('width', 20)[0];
                }
                return '';
            }
        }, {
            mentions: ['sender : Tn ngi gi', 'receiver : Tn ngi nhn'],
            match: /\B@(\w*)$/,
            search: function (keyword, callback) {
                callback($.grep(this.mentions, function (item) {
                    return item.indexOf(keyword) == 0;
                }));
            },
            template: function (item) {
                return '<span>' + item + '</span>';
            },
            content: function (item) {
                return '{{' + item.toString().charAt(0) + '}}';
            }
        }]
    });

    $(id).summernote('code', content);
}

function messageDialogOpening(title, message, okBtntext, okCallback) {
    swal(
        {
            title: title,
            text: message,
            type: 'success',
            confirmButtonClass: 'btn btn-confirm mt-2',
            confirmButtonText: okBtntext
        }
    ).then(function () {
        okCallback();
    }, function () {
    });

}

function confirmDialogOpening(title, message, confirmBtnText, cancelBtnText, okCallback, cancelCallback) {

    swal({
        title: title,
        text: message,
        type: 'warning',
        showCancelButton: true,
        confirmButtonClass: 'btn btn-confirm mt-2',
        cancelButtonClass: 'btn btn-cancel ml-2 mt-2',
        confirmButtonText: confirmBtnText,
        cancelButtonText: cancelBtnText
    }).then(function () {
        if (okCallback != undefined) {
            okCallback();
        }

    }, function () {
        if (cancelCallback != undefined)
            cancelCallback();
    })
}

function inputDialogOpening(title, content, typeOfInput, okCallback, cancelCallback, okBtnText, cancelBtnText) {
    swal.setDefaults({
        input: typeOfInput,
        confirmButtonText: okBtnText,
        cancelButtonText: cancelBtnText,
        showCancelButton: true,
        animation: false,
        confirmButtonClass: 'btn btn-confirm mt-2',
        cancelButtonClass: 'btn btn-cancel ml-2 mt-2'
    })

    var steps = [
        {
            title: title,
            text: content
        }
    ]

    swal.queue(steps).then(function (result) {
        swal.resetDefaults();

        if (okCallback != undefined)
            okCallback(result);

    }, function () {
        swal.resetDefaults();

        if (cancelCallback != undefined)
            cancelCallback();
    })
}

